import{k as s,o as t,c as e,l as o}from"./index.091d8df5.js";import{b as a}from"./route-block.b5bad31b.js";const c={class:"markdown-body"},i=o(`<h1>Cara Ringkas Commit Git</h1><p>Untuk commit Git, perintahnya adalah:</p><pre class="language-bash"><code class="language-bash"><span class="token function">git</span> <span class="token function">add</span> <span class="token builtin class-name">.</span>
<span class="token function">git</span> commit -m <span class="token string">&quot;Pesannya&quot;</span>
</code></pre><p>Atau, bisa juga dibuat inline menjadi:</p><pre class="language-bash"><code class="language-bash"><span class="token function">git</span> <span class="token function">add</span> <span class="token builtin class-name">.</span> <span class="token operator">&amp;&amp;</span> <span class="token function">git</span> commit -m <span class="token string">&quot;Pesannya&quot;</span>
</code></pre><p>Cuma ya kadang malas ngetik sambil mikirin pesan commitnya apa. Akhirnya, aku pun membuat script supaya lebih ringkas.</p><p>Jadi, aku membuat sebuah file di path dengan nama file <code>g</code>. Di dalamnya berisi:</p><pre class="language-bash"><code class="language-bash"><span class="token builtin class-name">echo</span> Sebutkan pesan commitnya:
<span class="token builtin class-name">read</span> commit
<span class="token function">git</span> <span class="token function">add</span> <span class="token builtin class-name">.</span>
<span class="token function">git</span> commit -m <span class="token string">&quot;<span class="token variable">$commit</span>&quot;</span>
</code></pre><p>Kasih full permission dulu dengan:</p><pre class="language-bash"><code class="language-bash"><span class="token function">sudo</span> <span class="token function">chmod</span> +x g
</code></pre><p>Nah sekarang kalau mau commit, tinggal ketik <code>g</code>.</p>`,11),p=[i],b={meta:[]},l={name:"commit-ringkas",setup(m,{expose:n}){return s({meta:[]}),n({frontmatter:{meta:[]}}),(d,r)=>(t(),e("div",c,p))}};typeof a=="function"&&a(l);export{l as default,b as frontmatter};
